import React from "react";
import Card from "react-bootstrap/Card";

const ContentCard = (props) => {
  return (
    <div>
      <Card.Header>{props.title}</Card.Header>
      <Card.Body>
        <blockquote className="blockquote mb-0">
          <p>{props.content}</p>
        </blockquote>
      </Card.Body>
    </div>
  );
};

export default ContentCard;
